import React from 'react';
import './Home.css';
import CAD from '../Images/CAD.png';
import {Link} from 'react-scroll'; 

const intro = () => {
    return (
        <section id="intro">
            <div className="introContent">
                <span className="hello">Welcome to</span>
                <span className="introText">
                    <span className="introName">SC ARC <br/>
                    the Advanced Robotic Combat Design Team of USC</span>
                </span>
                <p className="introPara">Educating students in various fields of engineering and business through combat robotics.</p>
                <Link>
                    <button className="btn">
                        About Us
                    </button>
                </Link>
            </div>
            <img src={CAD} alt="CAD" className="bg"/>
        </section>
    )
}

export default intro
